import React from "react"

export default function ComParametro(props) {
    return (
        <div>
            <h2>{ props.titulo }</h2>
            <p>
                <strong>{ props.aluno }</strong>
                 tem nota 
                 <strong></strong>
            </p>
        </div>
    )
}
